  //Debugging 
  const { auth } = useAuth();


  return (
      <div class="text-middle">
        <img src={Logo} />
        <h1>Brudi, für dich heute leider nicht</h1>
        <h3>Dieser Bereich ist für den aktuell angemeldeten Nutzertyp nicht verfügbar</h3>
      </div>
    );
}


